import React, { Component } from 'react'

class Filter extends Component {
    constructor(props){
        super (props)
        this.state = {
            cityFilter: ""
        }
    }

    render() {
        return (
            <div>
        <label htmlFor="filter">Filter by Poet: </label>
        <input type="text" id="filter" value={this.state.poetFilter}/>
      </div>
        )
    }
}

export default Filter
